softwareDocApp.config(function(a){angular.extend(a.defaults,{dateFormat:"dd/MM/yyyy",startWeek:1})});softwareDocApp.controller("ProposedSolutionController",["$scope",function ProposedSolutionController(a){a.doc={};a.doc.selectedDate=new Date();a.doc.selectedDateAsNumber=Date.UTC(1986,1,22);a.getType=function(b){return Object.prototype.toString.call(a[b])};a.clearDates=function(){a.selectedDate=null};if(!a.doc.milestones){a.doc.milestones=[]}a.addMileStone=function(){a.doc.milestones.push({description:""})};if(!a.doc.useCases){a.doc.useCases=[]}a.addUseCase=function(){a.doc.useCases.push({id:a.doc.useCases.length+1,description:"",subCases:[]})};a.removeUseCase=function(){scope.remove()};a.addSubUseCase=function(c){var b=c.$modelValue;console.debug(b.id);b.subCases.push({id:b.id+"."+(b.subCases.length+1),description:"",subCases:[]})};a.addFuncCapability=function(){if(!a.doc.functionalCapabilities){a.doc.functionalCapabilities=[]}a.doc.functionalCapabilities.push({description:""})};a.addNonFuncCapability=function(){if(!a.doc.nonFunctionalCapabilities){a.doc.nonFunctionalCapabilities=[]}a.doc.nonFunctionalCapabilities.push({description:""})};a.submit=function(){console.log(a.doc)}}]);